</code></pre>
<p>My understanding is this will fetch all of the comments related to the contentIds in the <code>myContentIds</code> array and sort them in descending order based on the date.</p>
<p>I could then limit my results using <code>{ $limit: 1}</code> but this would return the most recent comment on any of the content items, rather than the most recent comment for each content.</p>
<p>How can I modify my query to return the most recent comment for each of my content items?</p>

