how can i wait until update query updated the collection?<ul>
<li>here I am taking all domain from test collection and checking it's working or not by sending HTTPS req and updating status in the same collection.</li>
<li>problem is when I get the first domain and its checks and updating status at that time I getting the next domain status also so it's throwing a mongo error.</li>
<li>so I want to know how can I wait until its update status in the collection(when run update query I need to stop checking the domain until it's updated).</li>
</ul>
<pre><code>router.get(&quot;/get&quot;, function (req, respo) {
  Client.connect(URL, function (err, db) {
    if (err) throw err;
    var dbo = db.db(&quot;gvm&quot;);

    dbo
      .collection(&quot;test&quot;)
      .find({
        $and: [{ IsDeleted: false }, { TrackDomain: { $nin: [null, &quot;&quot;] } }],
      })
      .project({
        ClientID: &quot;$_id&quot;,
        _id: 0,
        TrackDomain: 1,
        IsTrackDomainWorking: 1,
      })
      .toArray(function (error, sites) {
        if (err) throw error;

        sites.forEach((item) =&gt; {
          let TrackDomain = &quot;https://&quot; + item.TrackDomain;
          try {
            let isWorking = false;

            https.get(TrackDomain, async(res) =&gt; {
              if (res.statusCode == 200) {
                isWorking = true;
              }

              if (isWorking != item.IsTrackDomainWorking) {

                dbo.collection(&quot;test&quot;).findOneAndUpdate(
                  { $and: [{ _id: item.ClientID }, { IsDeleted: false }] },
                  {
                    $set: {
                      IsTrackDomainWorking: Boolean(isWorking),
                      LastUpdatedBy: item.ClientID,
                      LastUpdatedDate: new Date(),
                    },
                  },
                  function (err, data) {
                    if (err) throw err;

                    db.close();
                  }
                );
              }
            });
          } catch (error) {
            console.log(error);
          }
        });
        respo.send(&quot;done&quot;);
      });
  });
});

</code></pre>

