How to find duplicate records based on an id and a datetime field in MongoDB?<p>I have a MongoDB collection with millions of record. Sample records are shown below:</p>
<pre><code>[
  {
    _id: ObjectId(&quot;609977b0e8e1c615cb551bf5&quot;),
    activityId: &quot;123456789&quot;,
    updateDateTime: &quot;2021-03-24T20:12:02Z&quot;
  },
  {
    _id: ObjectId(&quot;739177b0e8e1c615cb551bf5&quot;),
    activityId: &quot;123456789&quot;,
    updateDateTime: &quot;2021-03-24T20:15:02Z&quot;
  },
  {
    _id: ObjectId(&quot;805577b0e8e1c615cb551bf5&quot;),
    activityId: &quot;123456789&quot;,
    updateDateTime: &quot;2021-03-24T20:18:02Z&quot;
  }
]
</code></pre>
<p>Multiple records could have the same <code>activityId</code>, in this case i want just the record that has the largest <code>updateDateTime</code>.</p>
<p>I have tried doing this and it works fine on a smaller collection but times out on a large collection.</p>
<pre><code>[
  {
    $lookup: {
      from: &quot;MY_TABLE&quot;,
      let: {
        existing_date: &quot;$updateDateTime&quot;,
        existing_sensorActivityId: &quot;$activityId&quot;
      },
      pipeline: [
        {
          $match: {
            $expr: {
              $and: [
                { $eq: [&quot;$activityId&quot;, &quot;$$existing_sensorActivityId&quot;] },
                { $gt: [&quot;$updateDateTime&quot;, &quot;$$existing_date&quot;] }
              ]
            }
          }
        }
      ],
      as: &quot;matched_records&quot;
    }
  },
  { $match: { &quot;matched_records.0&quot;: { $exists: true } } },
  { $project: { _id: 1 } }
]
</code></pre>
<p>This gives me <code>_id</code>s for all the records which have the same activity id but smaller <code>updateDateTime</code>.</p>
<p>The slowness occurs at this step -&gt; <code>&quot;matched_records.0&quot;: {$exists:true}</code></p>
<p>Is there a way to speed up this step or are there any other approach to this problem?</p>

