<p>I'm using <a href="https://mongodb.github.io/mongo-csharp-driver/2.5/apidocs/html/M_MongoDB_Driver_IMongoCollection_1_FindOneAndReplaceAsync__1.htm" rel="nofollow noreferrer">FindOneAndReplaceAsync(...)</a> and according to it, the default for the options is <code>null</code>.</p>
