    x =&gt; x.Id == target.Id, replacement, null, token);
</code></pre>
<p>Passing an explicit <code>null</code> works just as expected. However, when I create an instance of <a href="https://mongodb.github.io/mongo-csharp-driver/2.5/apidocs/html/T_MongoDB_Driver_FindOneAndReplaceOptions_1.htm" rel="nofollow noreferrer">FindOneAndReplaceOptions</a>, the compiler suddently worries about the object I'm performing my search on being undefined.</p>
